values:
Just another plain old day at the same net crib.
kakabadtrip ang ulan!!! ayoko ng ulan!!! (Sabi rin yan ni Gem.. )

Well we had a practice at my house (dapat sa roaa kaso s@#$!!!!) with my other band "Tickets".. and we had a new composition.. a little punk with a ditch of new wave.. 

Well 2 hours of counterstrike gaming is just enough to get my old skills from rolling out.. I missed that game especially with my blockmates.. It is quite relaxing with my tired body... I'm very exhausted since yesterday, probably because of playing basketball yesterday at school with some school outsiders and playing the same night at our nearby 
b-court, and damn we lost 2 games against all that court siders.Sheeeesh..

Badtrip tong day na to, wala ako maisip malagay dito.

Ok, one last thing (may stroke of genius na pumaso sa isip ko) before i click the update button

I'm now on a blasting Stasis Field like an empty can, studying mind over matter over an ensnaring situation. Disenchant me! <STYLE TYPE="text/css">p {align=justify}
